/**
 * Get a random word from the collection
 * @returns {string} A random Slovenian word
 */
export function getRandomWord() {
    return slovenskeBesede[Math.floor(Math.random() * slovenskeBesede.length)];
}

/**
 * Check if a word exists in the collection
 * @param {string} word - The word to check
 * @returns {boolean} True if the word exists in the collection
 */
export function isSlovenianWord(word) {
    return slovenskeBesede.includes(word.toLowerCase());
}

/**
 * Get all words that start with a specific prefix
 * @param {string} prefix - The prefix to search for
 * @returns {string[]} Array of words that start with the prefix
 */
export function getWordsByPrefix(prefix) {
    return slovenskeBesede.filter(word => 
        word.toLowerCase().startsWith(prefix.toLowerCase())
    );
}

export default slovenskeBesede;
